import { Button } from "@mui/material";
import React, {useState} from "react";
import styled from 'styled-components'

export default function Todo() {
    const [count, setTodo] = useState(0)
    return (<>
        <p></p>
        <Button onClick={() => setTodo(count + 1)}></Button>
    </>)
}
